fields.static_content:
{"de": "####Pflicht zur Nutzung der Sonnenenergie bei Gebäuden (Neubauten) gemäss Energiegesetz (EnG)

Gemäss Artikel 45a EnG ist beim Bau neuer Gebäude mit einer anrechenbaren Gebäudefläche von mehr als 300 m2 auf den Dächern oder an den Fassaden eine Solaranlage, beispielsweise eine Photovoltaik- oder eine Solarthermieanlage, zu erstellen. 

Gemäss Artikel 29a des Energiereglements (EnR) muss die Leistung der installierten Solaranlage mindestens  20 W pro m2 anrechenbarer Gebäudefläche betragen.", "fr": "", "it": ""}

fields.info_text:
{"de": "Das Zweitwohnungsgesetz (ZWG) gelangt in verschiedenen Gemeinden des Kantons Graubünden zur Anwendung. In diesen Gemeinden ist der Neubau von Zweitwohnungen nicht zulässig. Bauwillige haben daher mit dem Baugesuch bekannt zu geben, ob bzw. welche Wohnungen touristisch bewirtschaftet werden und welche Wohnungen als Erstwohnung oder als einer Erstwohnung gleichgestellte Wohnung genutzt werden sollen.¹

Diese Angaben sind in einem Plan zu verorten oder in einem Wohnungsspiegel zu bezeichnen.

¹ <font size="1">unter Hinweis auf die <a href="https://www.gr.ch/DE/institutionen/verwaltung/dvs/ds/Documents/Zweitwohnungen/Vollzugshilfe DVS V2a_de.pdf">kantonale Vollzugshilfe: Bundesgesetz über Zweitwohnungen (ZWG; SR 702), Zweitwohnungsverordnung (ZWV; SR 702.1)</a></font>", "fr": null, "it": null}

{"de": "####INFO

Anzahl Zimmer

Die Anzahl Zimmer umfasst alle bewohnbaren Räume der Wohnung wie Wohnzimmer, Schlafzimmer usw. Nicht gezählt werden Küche, Badezimmer, Duschen, Toiletten, Abstellräume, Korridore, halbe Zimmer, Veranden sowie zusätzliche separate Wohnräume ausserhalb der Wohnung.", "fr": null, "it": null}
